systemInfoPppoe:'ภายใต้โหมดการเชื่อมต่อแบบบรอดแบนด์ (PPPoE) คลิก "ยกเลิกการเชื่อมต่อ" เพื่อยกเลิกการเชื่อมต่อกับเซิร์ฟเวอร์ของผู้ให้บริการ และคลิก "เชื่อมต่อ"เพื่อเชื่อมต่อบรอดแบนด์เข้าสู่ระบบอินเตอร์เน็ต',backupReset:"จากฟังก์ชั่นนี้ สามารถสำรองข้อมูลการตั้งค่าปัจจุบันของเราเตอร์ไปยังอุปกรณ์ปลายทางได้ เมื่อเราเตอร์พบอุปสรรคหรืออุปกรณ์สูญหาย ก็สามารถทำการกู้คืนจากอุปกรณ์ที่เคยทำการสำรองไว้ได้",backupResetTip:"อุปกรณ์เราเตอร์คืนค่าโรงงาน จะทำการลบข้อมูลผู้ใช้ทั้งหมดกลับไปสู่สภาวะที่เพิ่งจพออกจากโรงงาน",
ddns:"นำโดเมนคงที่และ IP WAN ของเราเตอร์ดำเนินการเชื่อมโยง ซึ่งโฮสต์และเราเตอร์บนอินเตอร์เน็ตกำลังส่งสัญญาณ ก็สามารถดำเนินการเข้าชมผ่านโดเมนได้",ddnsProvider:"ผู้ให้บริการ",ddnsProviderOray:"เลือกผู้ให้บริการ DDNS, NO-IP (noip.com) หรือ DynDNS (dyn.com)",ddnsTip:"ระบุชื่อผู้ใช้ รหัสผ่านและชื่อโฮสต์ที่ให้บริการโดย DDNS หลังจากที่คุณลงทะเบียนบัญชีในเว็บไซต์แล้ว",deviceMng:"สามารถเช็คดูรายการอุปกรณ์ที่เชื่อมต่อเครือข่าย ที่ออฟไลน์และที่ถูกบล็อก อนุญาตให้แก้ไขอุปกรณ์ที่อยู่ในรายการ เพื่อตอบสนองความต้องการในการบล็อกการเข้าถึงอินเตอร์ของอุปกรณ์ การแก้ไขชื่อ อุปกรณ์และการจำกัดความเร็วอุปกรณ์ เป็นต้น",
