vpnClient:"ไคลเอนต์ของเครือข่ายส่วนตัวเสมือน (VPN) ถูกใช้เพื่อเชื่อมต่อกับเซิร์ฟเวอร์ VPN เพื่อเข้าถึงแหล่งข้อมูลส่วนตัวอย่างปลอดภัยผ่านเครือข่ายสาธารณะ คุณต้องสร้างกฎสำหรับไคลเอนต์เพื่อเชื่อมต่อกับเซิร์ฟเวอร์ VPN โดยใช้ชื่อกฎ , โปรโตคอลแอดเดรส IP ของเซิร์ฟเวอร์ VPN (หรือโดเมน) และกำหนดค่าข้อมูลการตรวจสอบสิทธิ์เข้าถึงแล้วคลิกเชื่อมต่อเพื่อสร้างการเชื่อมต่อ VPN",vpnServer:"เลือกประเภทโปรโตคอลของเซิร์ฟเวอร์ VPN ตั้งค่าบัญชีและรหัสผ่านสำหรับการล็อกอินของ VPN Client หลังจากเชื่อมต่อ VPN ไคลเอนต์แล้วจะมีสิทธิเหมือนกับอุปกรณ์ทางฝั่ง LAN ของเราเตอร์",
wds:"ใช้ฟังก์ชั่น WDS ซับเราเตอร์สามารถเชื่อมต่อขอบเขตที่ครอบคลุมการขยายของเครือข่าย wifi สามารถสแกนอัตโนมัติ (แนะนำ)หรือใช้มือกรอกเพื่อเชื่อมต่อเพื่อขยายเครือข่าย wifi ",qosHelp:"คุณภาพบริการ (QoS) เป็นเทคโนโลยีขั้นสูงสำหรับการจัดสรรแบนด์วิธ คุณสามารถเปิดใช้งาน QoS จัดลำดับความสำคัญของการเข้าชมที่เฉพาะเจาะจงเหนือผู้อื่น",light:"กำหนดค่าจอแสดงผล LED (เปิด/ปิด)",lightTip:"หมายเหตุ : ในสถานะปิด รีบูทเราเตอร์ ไฟ LED จะกลับมาในสถานะทำงาน 5 นาที",printer:"เมื่อเปิดฟังก์ชั่นนี้ จะนำเครื่องพิมพ์และเราเตอร์เชื่อมต่อกันทาง USB ตั้งค่าพารามิเตอร์ในอุปกรณ์ปลายทาง ก็จะเปลี่ยนเครื่องพิมพ์ของคุณให้เป็นเครื่องพิมพ์เครือข่าย เพื่อให้บริการพิมพ์กับผู้ใช้งานในระบบ LAN",
